import React from 'react';
import backgroundImage from '../assets/img/background.jpg'; // Import your background image
import '../assets/css/style.css'; // Import your CSS file

function WelcomePage() {
  return (
    <div className="container">
      <div className="background-image" style={{backgroundImage: `url(${backgroundImage})`}}></div>
      <div className="welcome-text">
        <h1>Welcome</h1>
        <div className="buttons">
          <button className="login-button">Wanna Login Here?</button>
          <button className="signup-button">Don't have an account?</button>
        </div>
      </div>
    </div>
  );
}

export default WelcomePage;
